import React, { Component } from 'react';
import './Char.css';


const Char = props =>  {

    let stringList;
    if (props.string){
        stringList = (
            <ol>
                {props.string.split("").map(c => <li on>{c}</li>)}
            </ol>
        );
    }


    return (
      <div >
        {stringList}
      </div>
    );

}

export default Char;
